import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Switch, Route, Link } from "react-router-dom";
import { ListaJuegos } from "./componentes/ListaGame";
import { ActualizaJuegos } from "./componentes/ActualizaGame";
import { AgregaJuegos } from "./componentes/AgregaGame";

function App() {return (

  <div>
    <nav className="navbar navbar-expand navbar-dark bg-dark">
      <a href="/" className="navbar-brand">
        TodoGame | Chile
      </a>
      <div className="navbar-nav mr-auto">
        <li className="nav-item">
          <Link exact to={"/add/"} className="nav-link">
            Agregar rese√±a
          </Link>
        </li>
      </div>
    </nav>
    <div className="container bg-dark">
    <Switch>
      <Route exact path={["/", "/menus"]} component={ListaJuegos} />
      <Route exact path="/add/" component={AgregaJuegos} />
      <Route path="/menu/:id/update/" component={ActualizaJuegos} />
    </Switch>

    </div>
  </div>


);



}

export default App;
